com.consistent.explorer.consistent_inter.script:
function get_call_state_label(type, state) {
        if (type > 2) return "" ;
        if (state == 0) return "Connecting" ;
        if (state == 1) return "Accepted" ;
        if (state == 2) return "Connected" ;
        if (state == 3) return "Rejected" ;
        return "" ;
}
function get_queue_name(queue_name, priority, absolute_priority) {
        if (queue_name == undefined) return "" ;
        return queue_name + '  (' + priority + ':' + absolute_priority + ')' ;
}
function display_queues(queues_string) {
        if (queues_string == "") return "" ;
        var queues = eval(queues_string) ;
        var result = "" ;
        var queue ;
        for (queue in queues) {
                var loc = queues[queue] ;
                if (loc.type == "queue") {
                        if (result != "") result = result + ", " ;
                        result = result + loc.queue ;
                }
        }
        return result ;
}
function decode_version(client_version) {
        if (client_version == 0) return "" ;
        var result = "" ;
        result += Math.floor(client_version / 16777216) + "." ;
        client_version = client_version - 16777216 * Math.floor(client_version / 16777216) ;
        result += Math.floor(client_version / 65536) + "." ;
        client_version = client_version - 65536 * Math.floor(client_version / 65536) ;
        result += Math.floor(client_version / 256) ;
        client_version = client_version - 256 * Math.floor(client_version / 256) ;
        if (client_version == 0) return result + " alpha" ;
        if (client_version < 128) return result + " beta " + client_version ;
        if (client_version == 128) return result ;
        return result + "." + (client_version - 128) ;
}
